import './App.css';
import Home from './screen/Home';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";



function App() {
  return (
      <Router>
        <div>
          <Routes>
            <Route exact path='/' ></Route>
          </Routes>
        </div>
      </Router>
  );
}

export default App;
